import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './Navbar';
import Sections from './Sections';
import PosLoginCompany from '../PosLoginCompany/PosLoginCompany'; // Ensure correct import path
import PosLoginLandowner from '../PosLoginLandowner/PosLoginLandowner'; // Import for Landowner
import forestImage from '../../images/forest.jpg'; // Update the path to your image
import '../../App.css'; // Make sure styles are imported

const App = () => {
    return (
        <Router>
            <div>
                <Navbar />
                <Routes>
                    {/* Home Route with Hero Section */}
                    <Route
                        path="/"
                        element={
                            <>
                                <header className="hero">
                                    <img
                                        src={forestImage} // Ensure the image path is correct
                                        alt="Hero"
                                        className="hero-image"
                                    />
                                    <div className="hero-overlay">
                                        <h1>Dad, How Do I?</h1> {/* Update with your project title */}
                                    </div>
                                </header>
                                <Sections /> {/* Add any sections for the homepage */}
                            </>
                        }
                    />
                    {/* Other Routes for Specific Pages */}
                    <Route path="/PosLoginCompany" element={<PosLoginCompany />} />
                    <Route path="/PosLoginLandowner" element={<PosLoginLandowner />} />
                    {/* Add more routes as needed */}
                </Routes>
            </div>
        </Router>
    );
};

export default App;
